// components/ProductReviews.js

import React, { useEffect, useState } from "react";
import {
  getProductReviews,
  addProductReview,
} from "../../services/ReviewService";

const ProductReviews = ({ productId }) => {
  const [reviews, setReviews] = useState([]);
  const [newReview, setNewReview] = useState({
    email: "",
    name: "",
    rating: 0,
    comment: "",
  });

  useEffect(() => {
    const fetchReviews = async () => {
      const fetchedReviews = await getProductReviews(productId);
      setReviews(fetchedReviews);
    };

    fetchReviews();
  }, [productId]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewReview({ ...newReview, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    await addProductReview({ ...newReview, productId });
    const updatedReviews = await getProductReviews(productId);
    setReviews(updatedReviews);
    setNewReview({ email: "", name: "", rating: 0, comment: "" });
  };

  return (
    <>
      <div className="col-md-6">
        <h4 className="mb-4">Các đánh giá cho sản phẩm</h4>
        {reviews.map((review, index) => (
          <div className="media mb-4" key={index}>
            <img
              src="data:image/webp;base64,"
              alt="Image"
              className="img-fluid mr-3 mt-1"
              style={{ width: "45px" }}
            />
            <div className="media-body">
              <h6>
                {review.name}
                <small>
                  - <i>{new Date(review.createdAt).toLocaleDateString()}</i>
                </small>
              </h6>
              <div className="text-primary mb-2">
                {[...Array(review.rating)].map((star, i) => (
                  <i key={i} className="fas fa-star"></i>
                ))}
                {[...Array(5 - review.rating)].map((star, i) => (
                  <i key={i} className="far fa-star"></i>
                ))}
              </div>
              <p>{review.comment}</p>
            </div>
          </div>
        ))}
      </div>
      <div className="col-md-6">
        <h4 className="mb-4">Đánh giá sản phẩm</h4>
        <small>
          Địa chỉ email của bạn sẽ không được công bố. Các trường bắt buộc được
          đánh dấu *
        </small>
        <form onSubmit={handleSubmit}>
          <div className="d-flex my-3">
            <p className="mb-0 mr-2">Điểm đánh giá của bạn * :</p>
            <div className="text-primary">
              {[...Array(newReview.rating)].map((star, i) => (
                <i
                  key={i}
                  className="fas fa-star"
                  onClick={() => setNewReview({ ...newReview, rating: i + 1 })}
                ></i>
              ))}
              {[...Array(5 - newReview.rating)].map((star, i) => (
                <i
                  key={i}
                  className="far fa-star"
                  onClick={() =>
                    setNewReview({
                      ...newReview,
                      rating: newReview.rating + i + 1,
                    })
                  }
                ></i>
              ))}
            </div>
          </div>
          <div className="form-group">
            <label htmlFor="comment">Đánh giá của bạn *</label>
            <textarea
              id="comment"
              name="comment"
              cols="30"
              rows="5"
              className="form-control"
              value={newReview.comment}
              onChange={handleInputChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="name">Tên của bạn *</label>
            <input
              type="text"
              className="form-control"
              id="name"
              name="name"
              value={newReview.name}
              onChange={handleInputChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="email">Email của bạn *</label>
            <input
              type="email"
              className="form-control"
              id="email"
              name="email"
              value={newReview.email}
              onChange={handleInputChange}
              required
            />
          </div>
          <div className="form-group mb-0">
            <input
              type="submit"
              value="Gửi đánh giá"
              className="btn btn-primary px-3"
            />
          </div>
        </form>
      </div>
    </>
  );
};

export default ProductReviews;
